    return (
        <div className="Navbar-Container" style={{
            width:'100%',
            display:'flex',
            justifyContent:'space-evenly',
            position:'sticky',
            top:"0",
            overflow:'hidden',}}>
            <a>About me</a>
            <a>Work</a>
            <a>Blog</a>
        </div>
    )
}

export default Navbar;
